class Solution:
    def minimumDeletions(self, s: str) -> int:
        # Use prefix sums to calculate minimum deletions
        N = len(s)
        res = float('inf')
        pfx_left = [0 for _ in range(N)]
        pfx_left[0] = int(s[0] == 'a')
        for i in range(1, N):
            pfx_left[i] = pfx_left[i-1] + int(s[i] == 'a')
        pfx_right = [0 for _ in range(N)]
        pfx_right[-1] = int(s[-1] == 'a')
        for i in range(N-2, -1, -1):
            pfx_right[i] = pfx_right[i+1] + int(s[i] == 'a')
        for i in range(N + 1):
            if i == 0:
                bleft = 0
            else:
                bleft = i - pfx_left[i-1]
            if i == N:
                aright = 0
            else:
                aright = pfx_right[i]
            res = min(res, bleft + aright)
        return res

